import React from "react";
import { Link, NavLink } from "react-router-dom";

const PatientHomePage = () => {
  return (
    <Link to="/visits" className="btn btn-primary" style={{ marginBottom: 20 }}>
      Visits
    </Link>
  );
};

export default PatientHomePage;
